import React from 'react';
import Layout from "../components/layout/index";

import ViewAllItems from "../components/ViewAllItems"

function ViewAllItemsPage({ match }) {
  return (
    <Layout
      body={<ViewAllItems />}
    />
  );
}

export default ViewAllItemsPage;
